        static void PrintMaze(char[,] maze)
        {
            int x = 3, y = 0;

            for (int i = 0; i < 48; i++)
            {
                x = 3;
                for (int j = 0; j < 100; j++)
                {
                    Console.SetCursorPosition(x, y);
                    Console.Write(maze[i, j]);
                    x++;
                }
                y++;
                Console.WriteLine(" ");
            }

            Console.ReadKey();
        }

        static void Movements(Car car1)
        {
            if (Keyboard.IsKeyPressed(Key.UpArrow))
            {
                car1.MoveCarUp();

            }
            if (Keyboard.IsKeyPressed(Key.DownArrow))
            {
                car1.MoveCarDown();

            }
            if (Keyboard.IsKeyPressed(Key.LeftArrow))
            {
                car1.MoveCarLeft();

            }
            if (Keyboard.IsKeyPressed(Key.RightArrow))
            {
                car1.MoveCarRight();

            }
        }
        static void PrintLanes(int i)
        {
            for (int y = 1 + i; y <= 40 + i; y += 6)
            {
                for (int x=4; x <= 100; x += 15)
                {
                    Console.SetCursorPosition(x, y);
                    Console.Write("|");
                }
            }
        }
        static void RemoveLanes(int i)
        {
            for (int y = 1 + i; y <= 40 + i; y += 6)
            {
                for (int x = 4; x <= 100; x += 15)
                {
                    Console.SetCursorPosition(x, y);
                    Console.Write(" ");
                }
